import styled from "styled-components";
import bg from './bg2.png';
import bg2 from './grid.png';
import Palettes from './Components/Palettes'
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Palette from "./Components/Palette";

function App() { // Declaring a function component named App
  return ( // Returning JSX
    <BrowserRouter> {/* Wrapping the JSX in BrowserRouter component */}
      <AppStyled bg={bg} grid={bg2}> {/* Applying styles to the JSX with the styled-components */}
        <div className="grid"></div> {/* Adding a div with a class name grid */}
        <Routes> {/* Wrapping Route components */}
          <Route path="/" element={<Palettes />} /> {/* Adding a Route component with a path and an element prop */}
          <Route path="/palette/:id" element={<Palette />} /> {/* Adding a Route component with a path and an element prop */}
        </Routes>
      </AppStyled>
    </BrowserRouter>
  );
}


const AppStyled = styled.div`
    min-height: 100vh;
    background-color: slateblue;
    background-image: url(${props => props.bg});
    background-repeat: no-repeat;
    background-size: cover;
    position: relative;
    .grid{
      position: absolute;
      width: 100%;
      height: 100%;
      background-image: url(${props => props.grid});
      background-repeat: repeat;
      z-index: 0;
    }
`;

export default App;
